import React, { useEffect, useState } from 'react';
import './App.css';

// Mock data for demonstration
const ProjectsData = {
  projects: [
    {
      title: "Canteen Website",
      summary: "A web platform for canteen management with ordering system",
      description: "Full-stack web application built with Python Flask backend and HTML/CSS/JS frontend. Features include menu management, order tracking, and user authentication.",
      technologies: ["Python", "Flask", "HTML", "CSS", "JavaScript", "SQLite"],
      link: "https://github.com/example"
    },
    {
      title: "Home Assistant",
      summary: "AI-powered voice assistant for home automation",
      description: "Smart home automation system using voice recognition and Arduino integration. Controls lights, temperature, and appliances through voice commands.",
      technologies: ["Python", "C++", "Arduino", "Voice Recognition"],
      link: "https://github.com/example"
    },
    {
      title: "Accommodation App",
      summary: "React-based accommodation booking platform",
      description: "Modern booking platform with real-time availability, user reviews, and secure payments. Built with React and Firebase for scalable performance.",
      technologies: ["React", "Firebase", "JavaScript", "CSS"],
      link: "https://github.com/example"
    }
  ],
  certifications: [
    {
      title: "Machine Learning Specialization",
      platform: "Coursera",
      credential: "ABC123DEF",
      link: "./Assets/cert1.jpg"
    },
    {
      title: "React Developer Certificate",
      platform: "FreeCodeCamp",
      credential: "XYZ789GHI",
      link: "./Assets/cert2.jpg"
    }
  ]
};

function App() {
  const w = [0, 1, 2, 3];
  const [window, setWindow] = useState(0);
  const [selectedProject, setSelectedProject] = useState(null);
  const [isDarkMode, setIsDarkMode] = useState(false);
  const [ropeStretch, setRopeStretch] = useState(0);
  const [isRopeDragging, setIsRopeDragging] = useState(false);

  const handleWindow = (e) => {
    console.log(e);
    setWindow(e);
  };

  const handleProject = (project) => {
    setSelectedProject(project);
    console.log(selectedProject);
  };

  // Initialize AOS only once
  useEffect(() => {
    // AOS would be initialized here
  }, []);

  // Handle rope dragging
  const handleRopeStart = (e) => {
    setIsRopeDragging(true);
    e.preventDefault();
  };

  const handleRopeMove = (e) => {
    if (!isRopeDragging) return;

    const rect = document.querySelector('.rope-container').getBoundingClientRect();
    const clientY = e.touches ? e.touches[0].clientY : e.clientY;
    const stretch = Math.max(0, Math.min(100, ((clientY - rect.top) / rect.height) * 100));
    setRopeStretch(stretch);

    // Toggle dark mode when rope is stretched more than 60%
    if (stretch > 60 && !isDarkMode) {
      setIsDarkMode(true);
    } else if (stretch < 30 && isDarkMode) {
      setIsDarkMode(false);
    }
  };

  const handleRopeEnd = () => {
    setIsRopeDragging(false);
    // Animate rope back to original position
    setRopeStretch(0);
  };

  useEffect(() => {
    if (isRopeDragging) {
      document.addEventListener('mousemove', handleRopeMove);
      document.addEventListener('mouseup', handleRopeEnd);
      document.addEventListener('touchmove', handleRopeMove);
      document.addEventListener('touchend', handleRopeEnd);
    }

    return () => {
      document.removeEventListener('mousemove', handleRopeMove);
      document.removeEventListener('mouseup', handleRopeEnd);
      document.removeEventListener('touchmove', handleRopeMove);
      document.removeEventListener('touchend', handleRopeEnd);
    };
  }, [isRopeDragging]);

  // Components
  const ProjectOverview = ({ SelectedProject }) => {
    if (!SelectedProject) return null;
    return (
      <div className='project-overview' style={{ display: SelectedProject != null ? 'block' : 'none' }}>
        <p style={{ margin: '0px', fontFamily: 'poppins', fontWeight: 'bold', color: 'grey', fontSize: '19px' }}>Project Overview</p>
        <div className='prj-thumbnail'>
          <div style={{ width: '500px', height: '500px', backgroundColor: '#f0f0f0', borderRadius: '7px', display: 'flex', alignItems: 'center', justifyContent: 'center', color: '#666' }}>
            Project Image
          </div>
        </div>
        <p style={{ fontFamily: 'poppins', fontSize: '19px', fontWeight: 'bold', color: 'grey' }}>{SelectedProject.title}</p>
        <div className='tect-lang'>
          {SelectedProject.technologies.map((tech, index) => (
            <p key={index}>{tech}</p>
          ))}
        </div>
        <p style={{ fontFamily: 'poppins' }}>{SelectedProject.description}</p>
        <a href={SelectedProject.link} style={{ textDecoration: 'none' }}>
          <div className='git-link'>
            <i className="fa-brands fa-github fa-lg" style={{ color: '#ffffff' }}></i>
            <p>Github</p>
          </div>
        </a>
      </div>
    );
  };

  const ProjectCards = ({ projectName, ProjectSummary, prj }) => {
    return (
      <div className="prj">
        <div className='prj-img-container'>
          <div style={{ width: '260px', height: '200px', backgroundColor: '#f0f0f0', borderRadius: '7px', display: 'flex', alignItems: 'center', justifyContent: 'center', color: '#666' }}>
            Project Image
          </div>
        </div>
        <h2>{projectName}</h2>
        <p style={{ width: '80%', fontFamily: 'poppins', fontSize: '14px' }}>{ProjectSummary}</p>
        <div className="view-prj" onClick={() => { handleProject(prj) }}>
          <p style={{ fontFamily: 'poppins', margin: '10px' }}>View</p>
          <i className="fa-solid fa-arrow-right" style={{ color: '#ffffff', marginRight: '10px' }}></i>
        </div>
      </div>
    );
  };

  const Bargraph = ({ w, tp }) => {
    return (
      <div className='topic-div'>
        <div style={{ fontFamily: 'poppins', fontWeight: 'bold', fontSize: '14px', color: 'rgb(89, 89, 89)', display: 'flex', alignItems: 'center' }}>{tp}</div>
        <div style={{ fontFamily: 'poppins', fontSize: '14px', width: `${w}%`, height: '95%', backgroundColor: '#1f0538', color: 'white', textAlign: 'center', fontWeight: 'bold', marginLeft: '20px', borderTopLeftRadius: '5px', borderBottomLeftRadius: '5px' }}>{w}</div>
      </div>
    );
  };

  const CertificateCard = ({ platform, credentials, title }) => {
    return (
      <div className='certficate-card'>
        <div className='cert-image'>
          <div style={{ width: '100%', height: '100%', backgroundColor: '#f0f0f0', borderRadius: '7px', display: 'flex', alignItems: 'center', justifyContent: 'center', color: '#666' }}>
            Certificate Image
          </div>
        </div>
        <a href='#' style={{ textDecoration: 'none', color: 'black', fontFamily: 'poppins' }}>
          <div className='cert-info'>
            <p style={{ fontWeight: 'bold' }}>{title}</p>
            <p>From : {platform}</p>
            <p>Credentials : {credentials}</p>
          </div>
        </a>
      </div>
    );
  };

  return (
    <div className={`layout ${isDarkMode ? 'dark-mode' : ''}`}>
      {/* Rope Toggle */}
      <div className="rope-container">
        <div className="rope-mount"></div>
        <div
          className="rope"
          style={{
            height: `${100 + ropeStretch}px`,
            transform: `scaleY(${1 + ropeStretch / 100})`,
          }}
          onMouseDown={handleRopeStart}
          onTouchStart={handleRopeStart}
        >
          <div className="rope-segments">
            {[...Array(8)].map((_, i) => (
              <div key={i} className="rope-segment"></div>
            ))}
          </div>
        </div>
        <div
          className="light-bulb"
          style={{
            transform: `translateY(${ropeStretch * 2}px)`,
            opacity: isDarkMode ? 0.3 : 1,
          }}
        >
          💡
        </div>
      </div>

      <div className="static-layout">
        <div className="options">
          <div className="opt" onClick={() => { handleWindow(0) }}>
            <i className="fa-regular fa-address-card fa-lg"></i>
            <p>About</p>
          </div>
          <div className="opt" onClick={() => { handleWindow(1) }}>
            <i className="fa-solid fa-laptop fa-lg"></i>
            <p>Projects</p>
          </div>
          <div className="opt" onClick={() => { handleWindow(2) }}>
            <i className="fa-solid fa-trophy fa-lg"></i>
            <p>Certifications</p>
          </div>
          <div className="opt" onClick={() => { handleWindow(3) }}>
            <i className="fa-solid fa-file fa-lg"></i>
            <p>CV/Resume</p>
          </div>
        </div>
      </div>

      <div className="dynamic-layout" id="dynamic">
        <p style={{ fontFamily: 'Poppins', fontSize: '35px', marginBottom: '0px', fontWeight: 'bold', marginLeft: '30px' }}>Aditya M Patil</p>

        <div className="home" style={{ display: window === 0 ? 'block' : 'none' }}>
          <h2 style={{ fontFamily: 'Poppins', marginLeft: '30px', color: 'grey' }}>Home</h2>
          <div className="banner-container">
            <div className="banner">
              <div className="image-container">
                <div style={{ width: '100%', height: '100%', backgroundColor: '#f0f0f0', borderRadius: '8px', display: 'flex', alignItems: 'center', justifyContent: 'center', color: '#666' }}>
                  Profile Image
                </div>
              </div>
              <div className="about-container">
                <div className="about">
                  <p style={{ color: '#FFD524', marginLeft: '20px', fontFamily: 'Poppins', fontWeight: 300, fontSize: '20px', marginBottom: '0px' }}>Welcome to my little corner of the web</p>
                  <p style={{ marginLeft: '20px', fontFamily: 'poppins', color: 'white', marginTop: '5px', fontSize: '13px', marginBottom: '10px' }}>Hello, I am Aditya Patil student at Dr. D. Y. Patil Institute of Engineering, Management and Research, Pune</p>
                  <p style={{ marginLeft: '20px', fontFamily: 'poppins', color: 'white', marginTop: '5px', fontSize: '13px', marginBottom: '10px' }}>I always try to seek for solution any technical problems. I love to solve this issues using my technical skills and learn them whenever needed. I have various projects in my bucket which were developed to solve such problems.</p>
                  <p style={{ marginLeft: '20px', fontFamily: 'poppins', color: 'white', marginTop: '5px', fontSize: '13px', marginBottom: '10px' }}>I have good knowledge of website development and deployment. Many of my project use web platform. Currently I am studying about Machine Learning and Advance Machine Learning concepts.</p>
                  <p style={{ marginLeft: '20px', fontFamily: 'poppins', color: 'white', marginTop: '5px', fontSize: '13px', marginBottom: '10px' }}>Apart from technical things I like to play video games as they are entertaining also they improve reflexes and increases fast decision making power.</p>
                </div>
              </div>
            </div>
          </div>

          <div className="stats">
            <div className="stat-label">
              <p>Find Me</p>
            </div>
            <div className="find-me">
              <i className="fa-brands fa-github fa-lg" style={{ color: 'black' }}></i>
              <a href='https://github.com/aadim112' style={{ textDecoration: 'none' }}>
                <p style={{ color: 'black' }}>Github</p>
              </a>
            </div>
            <div className="find-me">
              <div style={{ width: '30px', height: '30px', backgroundColor: '#ccc', borderRadius: '4px' }}></div>
              <a href='https://leetcode.com/u/aadi_m/' style={{ textDecoration: 'none' }}>
                <p style={{ color: 'black' }}>LeetCode</p>
              </a>
            </div>
            <div className="find-me">
              <div style={{ width: '30px', height: '30px', backgroundColor: '#ccc', borderRadius: '4px' }}></div>
              <a href='https://codolio.com/profile/Aaditya' style={{ textDecoration: 'none' }}>
                <p style={{ color: 'black' }}>Codolio</p>
              </a>
            </div>
            <div className="find-me">
              <i className="fa-brands fa-linkedin fa-lg" style={{ color: 'rgba(25, 102, 204, 0.7)', scale: '1.2' }}></i>
              <a href='https://www.linkedin.com/in/adityapatilm/' style={{ textDecoration: 'none' }}>
                <p style={{ color: 'black' }}>Linkedin</p>
              </a>
            </div>
            <div className="find-me">
              <div style={{ width: '30px', height: '30px', backgroundColor: '#ccc', borderRadius: '4px' }}></div>
              <a href='https://www.kaggle.com/aaditya112' style={{ textDecoration: 'none' }}>
                <p style={{ color: 'black' }}>Kaggle</p>
              </a>
            </div>
          </div>

          <p style={{ fontFamily: 'poppins', color: 'black', marginLeft: '30px', fontSize: '20px', fontWeight: 'bold' }}>Know my cards</p>
          <div className="tech-stack">
            <div className="cards">
              <div className='card-label'><p>Tech Stack</p></div>
              <div className='tec-container'>
                <div className='tech'>
                  <div style={{ width: '30px', height: '30px', backgroundColor: '#306998', borderRadius: '4px' }}></div>
                  <p>Python</p>
                </div>
                <div className='tech'>
                  <div style={{ width: '30px', height: '30px', backgroundColor: '#61dafb', borderRadius: '4px' }}></div>
                  <p>React</p>
                </div>
                <div className='tech'>
                  <div style={{ width: '30px', height: '30px', backgroundColor: '#e34c26', borderRadius: '4px' }}></div>
                  <p>HTML</p>
                </div>
                <div className='tech'>
                  <div style={{ width: '30px', height: '30px', backgroundColor: '#1572b6', borderRadius: '4px' }}></div>
                  <p>CSS</p>
                </div>
                <div className='tech'>
                  <div style={{ width: '30px', height: '30px', backgroundColor: '#000', borderRadius: '4px' }}></div>
                  <p>Flask</p>
                </div>
                <div className='tech'>
                  <div style={{ width: '30px', height: '30px', backgroundColor: '#ee4c2c', borderRadius: '4px' }}></div>
                  <p>PyTorch</p>
                </div>
              </div>
              <div className='tec-knowledge'>
                <p style={{ fontFamily: 'Noto Serif JP', textAlign: 'left', margin: '0px', fontSize: '19px' }}>Projects with the tech stack</p>
                <div className='tec-kn-container'>
                  <br />
                  <span style={{ fontFamily: 'poppins', fontWeight: 'bold' }}>Canteen Website - </span>
                  <span style={{ fontFamily: 'Poppins' }}>Python (Backend) | HTML CSS JavaScript (Frontend) | SQLite(Database)</span>
                  <br /><br />
                  <span style={{ fontFamily: 'poppins', fontWeight: 'bold' }}>Home Assistant - </span>
                  <span style={{ fontFamily: 'Poppins' }}>Python (Voice Recognition) | C++ (Arduino Programming)</span>
                  <br /><br />
                  <span style={{ fontFamily: 'poppins', fontWeight: 'bold' }}>Accommodation - </span>
                  <span style={{ fontFamily: 'Poppins' }}>React(JavaScript) (Frontend) | Firebase (Database)</span>
                  <br /><br />
                  <span style={{ fontFamily: 'poppins', fontWeight: 'bold' }}>Portfolio Website - </span>
                  <span style={{ fontFamily: 'Poppins' }}>Python (Backend) | HTML CSS JavaScript (Frontend) | SQLite(Database)</span>
                </div>
              </div>
            </div>
            <div className="cards">
              <div className='card-label'><p>Competitive</p></div>
              <div className='stat'>
                <div className='total-questions'>
                  <p>Total Questions</p>
                  <h2>59</h2>
                </div>
                <div className='total-questions'>
                  <p>Total Active Days</p>
                  <h2>30</h2>
                </div>
                <div className='DAS-topics'>
                  <p style={{ marginLeft: '20px', fontFamily: 'Poppins', color: 'grey', fontWeight: 'bold', marginBottom: '0px' }}>DSA Topics Analysis</p>
                  <div className='topics'>
                    <Bargraph w={20} tp='Array' />
                    <Bargraph w={8} tp='Sorting' />
                    <Bargraph w={8} tp='Greedy Algorithm' />
                    <Bargraph w={7} tp='String' />
                    <div style={{ width: '100%', height: '30px', alignItems: 'center', justifyContent: 'center', display: 'flex', fontFamily: 'poppins', fontSize: '12px', marginTop: '10px' }}>show more</div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>

        {/* Projects */}
        <div className="project-tab" style={{ display: window === 1 ? 'block' : 'none' }}>
          <h2 style={{ fontFamily: 'Poppins', marginLeft: '30px', color: 'grey' }}>Projects</h2>
          <div className='projects'>
            <div className='project-preview'>
              <p style={{ fontFamily: 'poppins', marginLeft: '30px', textAlign: 'left', width: '90%' }}>Working on projects is my most liked work. I do spend lot of time developing solutions to problems I see around me. Some of my works are below.</p>
              <div className="projects-container" style={{ gridTemplateColumns: selectedProject != null ? '300px 300px' : '300px 300px 300px' }}>
                {ProjectsData.projects.map((projects, index) => (
                  <ProjectCards
                    key={index}
                    projectName={projects.title}
                    ProjectSummary={projects.summary}
                    prj={projects}
                  />
                ))}
              </div>
            </div>
            <ProjectOverview SelectedProject={selectedProject} />
          </div>
        </div>

        <div className="Certification" style={{ display: window === 2 ? 'block' : 'none' }}>
          <h2 style={{ fontFamily: 'Poppins', marginLeft: '30px', color: 'grey' }}>Certifications</h2>
          <p style={{ fontFamily: 'poppins', marginLeft: '30px', textAlign: 'left', width: '90%' }}>Below are some of my certifications from well-known websites and competitive platforms.</p>
          <div className='certificate-container'>
            {ProjectsData.certifications.map((certificate, index) => (
              <CertificateCard
                key={index}
                title={certificate.title}
                platform={certificate.platform}
                credentials={certificate.credential}
              />
            ))}
          </div>
        </div>

        <div className="resume" style={{ display: window === 3 ? 'block' : 'none' }}>
          <div style={{ width: '100%', height: '600px', backgroundColor: '#f0f0f0', display: 'flex', alignItems: 'center', justifyContent: 'center', color: '#666', fontSize: '18px' }}>
            Resume PDF would be displayed here
          </div>
        </div>
      </div>

      <style jsx>{`
        /* Dark mode styles */
        .dark-mode {
          background-color: #1a1a1a;
          color: #ffffff;
        }

        .dark-mode .dynamic-layout {
          background-color: #1a1a1a;
          color: #ffffff;
        }

        .dark-mode .static-layout {
          background-color: #2d2d2d;
        }

        .dark-mode .opt {
          color: #ffffff;
        }

        .dark-mode .opt:hover {
          background-color: #3d3d3d;
        }

        .dark-mode .about {
          background-color: #2d2d2d !important;
        }

        .dark-mode .cards {
          background-color: #333333;
          box-shadow: 7px 7px 0px #555555;
        }

        .dark-mode .total-questions {
          background-color: #2d2d2d;
        }

        .dark-mode .DAS-topics {
          background-color: #2d2d2d;
        }

        .dark-mode .certficate-card {
          background-color: #2d2d2d;
        }

        .dark-mode .prj {
          background-color: #2d2d2d;
        }

        .dark-mode .project-overview {
          background-color: #2d2d2d;
          color: #ffffff;
        }

        .dark-mode .find-me p {
          color: #ffffff !important;
        }

        .dark-mode .find-me:hover p {
          color: #FFD524 !important;
